function transposeMatrix(arr) {
	
	var m=arr.length;
	var n=arr[0].length;
	
	//console.log(m+" "+n);
	
	var arr_T=[];
	for(var i=0;i<n;i++) {
		arr_T.push([]);
		for(var j=0;j<m;j++) {
			arr_T[i].push(0);
		}
	}
	
	for(var i=0;i<n;i++) {
		for(var j=0;j<m;j++) {
			arr_T[i][j]=arr[j][i];
		}
	}
	
	return arr_T;
	
}

