function addMatrix(m1,m2) {
	m3=[];
	for(var i=0;i<m1.length;i++) {
		m3.push([]);
		for(var j=0;j<m1[i].length;j++) {
			m3[i].push(m1[i][j]+m2[i][j]);
		}
	}
	return m3;
}

