function relu(data) {
	var data1=[];
	for(var ii=0;ii<data[0].length;ii++) {
		//console.log(ii+" "+data[0].length+" ");
		if(data[0][ii]<0) {
			data1.push(0);
		}
		else {
			data1.push(data[0][ii]);
		}
	}
	//console.log("relu "+data1[0]);
	//console.log("");
	return [data1];
}


