function softmax(data) {
	//console.log(data);
	var data1=[];
	var summ=0;
	for(var i=0;i<data[0].length;i++) {
		summ+=Math.exp(data[0][i]);
	} 
	
	for(var i=0;i<data[0].length;i++) {
		data1.push(Math.exp(data[0][i])/summ);
	}
	
	return data1;
	
}

