function predict(data,weights) {
	for(var i=0;i<weights.length;i=i+2) {
		//console.log(i);
		if(i!=weights.length-2) {
			//console.log("11111111111111111111111111111111");
			//console.log(data.length+" "+data[0].length);
			//console.log(weights[i].length+" "+weights[i][0].length);
			//var m5=multiplyMatrix(weights[i],data);
			//console.log(m5.length+" "+m5[0].length);
			//console.log(m5);
			data=relu(addMatrix(multiplyMatrix(weights[i],data),[weights[i+1]]));
		}
		else {
			//console.log("Data ",data);
			data=softmax(addMatrix(multiplyMatrix(weights[i],data),[weights[i+1]]));
			//console.log("Softmax ",softmax(addMatrix(multiplyMatrix(weights[i],data),[weights[i+1]])));
		}
		//console.log(data);
		
	}
	//console.log("Data ",data);
	return data;
}


function getmaxx(data) {

	var maxx=0;
	var index=0;
	
	for(var i=0;i<data.length;i++) {
		if(data[i]>maxx) {
			maxx=data[i];
			index=i;
		}
	}
	
	return index;
}

function getClass(s) {
	//var s="Introduction to Neural Networks, Deep Learning (Deeplearning.ai course)";
	s=s.replace(/[^a-zA-Z]/g," ");
	s=s.toLowerCase();
	s=s.split(" ");
	//console.log(s);
	var arr=[];

	var l=Object.keys(feature_names).length/2;

	for(var i=0;i<s.length;i++) {
		if(s[i]!="" && !stopwords.has(s[i])) {
			arr[i]=(stemmer(s[i]));
		}
	}

	//console.log(arr);

	var X=[];

	for(var i=0;i<l;i++) {
		X.push(0);
	}
	
	for(var i=0;i<arr.length;i++) {
		//console.log(feature_names[arr[i]]);
		X[parseInt(feature_names[arr[i]])]=1;
	}

	//console.log("X "+X);
	
	//console.log(predict([X],weights));
	
	//console.log(getmaxx(predict([X],weights)));
	
	//console.log(allwords[getmaxx(predict([X],weights))]);
	
	return getmaxx(predict([X],weights));

}


